import React from 'react'

function Member(props) {
    const {member} = props;
    return (
        <div>
            <div>Basics</div>
            <hr />
            <div class="row">
                <div class="col-2">Nick Name</div>
                <div class="col-5">{ member.nickName }</div>
            </div>
            <div class="row">
                <div class="col-2">First Name</div>
                <div class="col-5">{ member.firstName }</div>
            </div>
        </div>
    )
}


export default Member;
